import React from "react";
import { Link } from "react-router-dom";
import { SearchBox } from "../search-box/search-box.components";
import "./header.style.css"


export const Header = ({searchChange})=>{
    return <header className="header ">
            <h1 className="display-1">Product List</h1>   
            <button id="add-product-btn" >Add Product</button>
            <button id="delete-product-btn" >Delete Product</button>
            <SearchBox searchChange={searchChange}/>
            <Link to ='/add' className="navbar-brand">Add</Link>
             <hr />
          </header>
}
